function Hero() {
  return (
    <div className="flex flex-col w-full bg-yellow-400 items-center justify-items-center">
      <div className="flex flex-col absolute w-10/12 items-center justify-items-center">
        <div className="w-full items-center">
          <img
            src="/images/elizabeth-jamieson-eAGrLZloIBc-unsplash.jpg"
            alt="Tajmahal"
            className="w-full object-contain h-48"
          ></img>
        </div>
      </div>
    </div>
  );
}

export default Hero;
